  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Okefenokee NWR
  outlines Refuge accomplishments from February through April of 1942. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, furbearers, predators, mammals,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, collections and receipts, and wildfires. The public relations
  section of the report describes Refuge visitors.\",\n\t\"license_title\": \"License
